"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"mobipreview.htm?42/10/43173/abstract/21\">",
"      Gennari C, Agnusdei D, Camporeale A. Use of calcitonin in the treatment of bone pain associated with osteoporosis. Calcif Tissue Int 1991; 49 Suppl 2:S9.",
"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"mobipreview.htm?42/10/43173/abstract/22\">",
"      Lyritis GP, Ioannidis GV, Karachalios T, et al. Analgesic effect of salmon calcitonin suppositories in patients with acute pain due to recent osteoporotic vertebral crush fractures: a prospective double-blind, randomized, placebo-controlled clinical study. Clin J Pain 1999; 15:284.",
"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"mobipreview.htm?42/10/43173/abstract/23\">",
"      Lyritis GP, Paspati I, Karachalios T, et al. Pain relief from nasal salmon calcitonin in osteoporotic vertebral crush fractures. A double blind, placebo-controlled clinical study. Acta Orthop Scand Suppl 1997; 275:112.",
"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"mobipreview.htm?42/10/43173/abstract/24\">",
"      Lufkin EG, Wahner HW, O'Fallon WM, et al. Treatment of postmenopausal osteoporosis with transdermal estrogen. Ann Intern Med 1992; 117:1.",
"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"mobipreview.htm?42/10/43173/abstract/25\">",
"      Watts, NB, Harris, ST, Genant, HK, et al. Intermittent cyclical etidronate treatment of postmenopausal osteoporosis. N Engl J Med 1990; 323:73.",
"     </a>",
"    </li>",
"    <li>",
"     European Medicines Agency recommends limiting long-term use of calcitonin medicines file://www.ema.europa.eu/ema/index.jsp?curl=pages/medicines/human/public_health_alerts/2012/07/human_pha_detail_000065.jsp&amp;mid=WC0b01ac058001d126 (Accessed on October 17, 2012).",
"    </li>",
