"       </a>",
"       ]",
"      </span>",
"     </div>",
"    </li>",
"    <li>",
"     <div class=\"reference\">",
"      Cairo MS, &ldquo;The Use of Ifosfamide, Carboplatin, and Etoposide in Children With Solid Tumors,&rdquo;",
"      <i>",
"       Semin Oncol",
"      </i>",
"      , 1995, 22(3 Suppl 7):23-7.",
"      <span class=\"pubmed-id\">",
"       [PubMed",
"       <a href=\"mobipreview.htm?42/10/43174/abstract-text/7610395/pubmed\" id=\"7610395\" target=\"_blank\">",
