"     <div class=\"reference\">",
"      Calvert AH, Newell DR, Grumbell LA, et al, &ldquo;Carboplatin Dosage: Prospective Evaluation of a Simple Formula Based on Renal Function,&rdquo;",
"      <i>",
"       J Clin Oncol",
"      </i>",
"      , 1989, 7(11):1748-56.",
