" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Antibiotic therapy for osteomyelitis in adults",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       Infectious agent",
"      </td>",
"      <td class=\"subtitle1\">",
"       Antibiotic",
"      </td>",
"      <td class=\"subtitle1\">",
"       Dosing",
"      </td>",
"     </tr>",
"     <tr>",
"      <td rowspan=\"3\">",
"       MSSA",
"      </td>",
"      <td>",
"       Nafcillin",
"      </td>",
"      <td>",
"       1-2 g intravenously every 6 hours",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Oxacillin",
"      </td>",
"      <td>",
"       1-2 g intravenously every 6 hours",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Cefazolin",
"      </td>",
"      <td>",
"       1 g intravenously every 8 hours",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       MRSA*",
"      </td>",
"      <td>",
"       Vancomycin",
"      </td>",
"      <td>",
"       30 mg/kg intravenously every 24 hours in 2 equally divided doses; not to exceed 2 g/24 hours unless concentrations in serum are inappropriately low",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Coagulase negative staphylococci",
"      </td>",
"      <td>",
"       Vancomycin",
"      </td>",
"      <td>",
"       30 mg/kg intravenously every 24 hours in 2 equally divided doses; not to exceed 2 g/24 hours unless concentrations in serum are inappropriately low",
"      </td>",
"     </tr>",
"     <tr>",
"      <td rowspan=\"4\">",
"       Gram negative organisms (including Pseudomonas)",
"      </td>",
"      <td>",
"       Ciprofloxacin",
"      </td>",
"      <td>",
"       750 mg orally twice daily",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Levofloxacin",
"      </td>",
"      <td>",
"       750 mg orally once daily",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Ceftazidime",
"      </td>",
"      <td>",
"       2 g intravenously every 8 hours",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Cefepime",
"      </td>",
"      <td>",
"       2 g intravenously every 12 hours",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Empiric therapy",
"      </td>",
