"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\" colspan=\"3\">",
"        For concentrated formula (40 kcal/oz)*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2\">",
"        Caloric density (kcal/oz)",
"       </td>",
"       <td class=\"subtitle2\">",
"        Volume concentrate (oz)",
"       </td>",
"       <td class=\"subtitle2\">",
"        Volume water (oz)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        20",
"       </td>",
"       <td>",
"        13",
"       </td>",
"       <td>",
"        13",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        22",
"       </td>",
"       <td>",
"        13",
"       </td>",
"       <td>",
"        10.5",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
