"       </td>",
"       <td>",
"        13",
"       </td>",
"       <td>",
"        8.5",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1\" colspan=\"3\">",
"        For powdered formula (40 kcal/scoop)",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2\">",
"        Caloric density (kcal/oz)",
"       </td>",
"       <td class=\"subtitle2\">",
"        Volume powder (scoops)",
"       </td>",
"       <td class=\"subtitle2\">",
"        Volume water (oz)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        20",
"       </td>",
"       <td>",
"        1",
"       </td>",
"       <td>",
"        2",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        22",
"       </td>",
"       <td>",
"        1",
"       </td>",
"       <td>",
"        1.8",
"       </td>",
