"        Kcal/unit",
"       </td>",
"       <td class=\"subtitle2\">",
"        Comments",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Polycose powder (glucose polymer)",
"       </td>",
"       <td>",
"        8 kcal per teaspoon",
"       </td>",
"       <td>",
"        Increases osmolality",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Polycose liquid (glucose polymer)",
"       </td>",
"       <td>",
"        2 kcal/mL",
"       </td>",
"       <td>",
"        Increases osmolality",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Corn syrup",
"       </td>",
"       <td>",
"        3.8 kcal/mL",
"       </td>",
"       <td>",
"        Increases osmolality",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2\" colspan=\"3\">",
"        Fat",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
