"       </td>",
"       <td>",
"        7.7 kcal/mL",
"       </td>",
"       <td>",
"        Nonemulsified",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Corn oil",
"       </td>",
"       <td>",
"        8.4 kcal/mL",
"       </td>",
"       <td>",
"        Nonemulsified",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Safflower oil",
"       </td>",
"       <td>",
"        8.4 kcal/mL",
"       </td>",
