"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Based on the calculation: ((a x b)/c) - a = y.",
"     <br>",
"      a = volume of formula to be diluted (ie, 13 oz), b = caloric density of formula (40 kcal/oz), c = desired caloric density (kcal/oz), and y = amount of water needed.",
